        return ( 
            <React.Fragment>
                <h1>Shopping Card</h1> 
                <button onClick={onReset} 
                className="btn btn-secondary btn-sm m-2">Reset</button>
                <div className="container">

                </div>
            </React.Fragment>
        )
    }
}

export default Carts;


{details.map(one => (
    <Products
    className=""
    key={one.id} 
    onDelete={onDelete}
    product={one}
    onIncrement={onIncrement}
    onDis={onDis}
    price={handelPrice}
    />


))}
